function todayeng()
{
	var x;
	var t=new Date();
	x=(t.getMonth()+1) + "/" +  t.getDate() + "/" + t.getFullYear();
	return x;
}


//get todays rough nepali date from English Date
//returns nepali Date format YYYY/MM/DD
function todaynep(engdate)
{
	var ret;
	var mm;
	var dd;
	var yy;
	if(engdate==NaN || engdate==undefined || engdate==null)
	{
		engdate=todayeng();
	}
	ret=engdate;//todayeng();
	var t=ret.split("/");
	ret="";
	mm=parseInt(t[0]);
	dd=parseInt(t[1]);
	yy=parseInt(t[2]);
	dd=dd+13;
	if(dd>30)
	{
		dd=dd-30;
		mm=mm+1;
	}
	mm=mm+8;
	if(mm>12)
	{
		mm=mm-12;
		yy=yy+1;
	}
	yy=yy+56;
	ret=yy + "/" + mm + "/" + dd;
	// ret=dd + "/" + mm + "/" + yy;
	return ret;
}
